[[package]]
name = "lightning-utilities"
version = "0.10.1"
description = "Lightning toolbox for across the our ecosystem."
category = "main"
optional = false
python-versions = ">=3.7"

[package.dependencies]
packaging = ">=17.1"
setuptools = "*"
typing-extensions = "*"

[package.extras]
cli = ["fire"]
docs = ["requests (>=2.0.0)"]
typing = ["mypy (>=1.0.0)", "types-setuptools"]

[[package]]
name = "ligo-segments"
version = "1.4.0"
description = "Representations of semi-open intervals"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
six = "*"

[[package]]
name = "ligotimegps"
version = "2.0.1"
description = "A pure-python version of lal.LIGOTimeGPS"
category = "main"
optional = false
python-versions = ">=3.4"

[[package]]
name = "matplotlib"
version = "3.7.4"
description = "Python plotting package"
category = "main"
optional = false
python-versions = ">=3.8"

[package.dependencies]
contourpy = ">=1.0.1"
cycler = ">=0.10"
fonttools = ">=4.22.0"
importlib-resources = {version = ">=3.2.0", markers = "python_version < \"3.10\""}
kiwisolver = ">=1.0.1"
